import {$host} from "./index";

export const createOrder = async (user_id, shop_id, brand_id, orderDetails) => {
    try {
        const order = await $host.post('api/order/createOrder', {user_id, shop_id, brand_id, orderDetails})
        return order;
    } catch (e) {
        console.log(e);
    }
}
